import React, { useEffect } from 'react';

const Home = () => {
  useEffect(() => {
    // Add logic here to reset animation after certain duration (if needed)
    const timeout = setTimeout(() => {
      // Logic to reset the animation if needed after certain duration
    }, 3000); // Adjust the duration to match the animation duration

    return () => {
      clearTimeout(timeout);
    };
  }, []);

  return (
    <div className="text-center">
      <h1 className="blow-up-element">
        <i>
          <b>Welcome to KITCHENERS SPELL</b>
        </i>
      </h1>
    </div>
  );
};

export default Home;
